import {
  GET,
  POST,
  DESTROY,
  PUT,
  PATCH
} from '../actions/form-actions.js';

const initialReducerState = {};

const formReducer= (state, action) => {
  if (state === undefined) {
    console.log('Unable to retrieve state, returning initialReducerState instead.');
    return initialReducerState;
  };





};
